var title_f17_58_18337="Necrosis versus apoptosis";
var content_f17_58_18337=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F71513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F71513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 504px\">",
"   <div class=\"ttl\">",
"    Necrosis versus apoptosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 484px; height: 249px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cells either die in an unregulated distension and protein denaturation (necrosis) or in a tightly programmed series of events (apoptosis) orchestrated by a series of capsase enzymes. Necrotic cells enlarge in the process of dying whereas in apoptosis the cell shrinks and develops surface blebs (far right picture) which contain apoptotically modified self antigens. The larger blebs contain nucleosomal DNA, Ro, La, and the small nuclear ribonucleoproteins. The cells eventually fragment and are cleared by macrophages. It is hypothesized that modified nucleoprotein complexes, which escape phagocytosis, can be taken up by antigen presenting cells with a resulting autoimmune response.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Mixed connective tissue disease and other overlap syndromes. In: Kelley s Textbook of Rheumatology, 7th ed, Harris, ED, Budd, RC, Firestein, GS, et al (Eds), W.B. Saunders 2004. Copyright &copy; 2004 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
