"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 510px\">",
"   <div class=\"ttl\">",
"    Anatomy of the thoracic outlet",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 490px; height: 398px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The thoracic outlet refers to the confined space between the clavicle and first rib. Structures that pass through this region include the nerves of the brachial plexus, the subclavian artery and subclavian vein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
