var title_f17_58_18343="Breast MRI for evaluating extent of disease - case 1";
var content_f17_58_18343=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F55600%7ESURG%2F82069&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F55600%7ESURG%2F82069&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 529px\">",
"   <div class=\"ttl\">",
"    Breast MRI for evaluating extent of disease - case 1",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 509px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Breast MRI can be used to determine the extent of disease in newly diagnosed cancer patient. The figure depicts the breast MRI of a patient with a palpable mass. Core biopsy revealed invasive lobular carcinoma. Preoperative MRI revealed extensive disease spanning over 7 cm with multiple irregular areas of enhancement (A) with intermediate signal on T2-weighted sequences (B).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 534px\">",
"   <div class=\"ttl\">",
"    Breast MRI for evaluating extent of disease - case 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 514px; height: 328px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Breast MRI can be used to determine the extent of disease in newly diagnosed cancer patient. Architectural distortion was detected in the central left breast on screening mammography. Diagnostic mammography confirmed persistence of the abnormality (A) and biopsy under ultrasound-guidance confirmed invasive ductal carcinoma. Preoperative MRI confirmed the large invasive cancer in the left breast (B) and a second suspiciously enhancing lesion in the outer right breast (C). Subsequent biopsy of the right breast finding revealed an invasive ductal cancer confirming contralateral disease.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
