var title_f17_58_18346="Right lung atelectasis";
var content_f17_58_18346=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F68141%7EPULM%2F75657%7EPULM%2F54715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F68141%7EPULM%2F75657%7EPULM%2F54715&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Complete atelectasis of the right lung",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 392px; height: 375px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Complete atelectasis of the right lung due to a tuberculous stricture in the right main stem bronchus. There is complete opacification of the right hemithorax with marked cardiomediastinal shift to the right side. As a result, the cardiac silhouette is obscured by the collapsed lung. The left lung is hyperexpanded and herniates anteriorly across the midline into the right hemithorax. The aortic arch imprint is clearly visible in the lower trachea (arrow) and should not be mistaken for tracheal stenosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Complete atelectasis of the left lung",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 289px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Bedside chest radiograph of a intubated patient with complete left lung atelectasis. The endotracheal tube was advanced too far into the airway, obstructing the left mainstem bronchus. The left hemithorax is completely opaque. The cardiac silhouette is totally obscured due to its deviation into the left hemithorax.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Frontal chest radiograph shows complete atelectasis of the left lung and right upper lobe atelectasis due to right mainstem bronchus intubation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Marked mediastinal shift to the left with hyperexpansion of the right middle and lower lobes is evident.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
