var title_f17_58_18350="Low dose warfarin after CABG";
var content_f17_58_18350=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60976&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60976&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 523px\">",
"   <div class=\"ttl\">",
"    Low-dose warfarin improved outcome after coronary artery bypass graft surgery",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 503px; height: 349px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the Post Coronary Artery Bypass Graft trial, which enrolled 1351 patients, low dose warfarin therapy (1 to 4 mg/day) had no effect on the composite clinical endpoint of death, myocardial infarction, need for revascularization procedures, or stroke at the end of the trial. However, at the end of the 7.5 year extended follow-up period, there was a 17 percent reduction in the composite clinical endpoint (p = 0.04).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Knatterud GL, Rosenberg Y, Campeau L, et al. Circulation 2000; 102:157.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
